import React from 'react';
import './Posts.css';
import ThumbUpOffAltIcon from '@mui/icons-material/ThumbUpOffAlt';
import ThumbDownOffAltIcon from '@mui/icons-material/ThumbDownOffAlt';
import Button from '../../button/Button';

export default function Posts() {
    return (
        <div className="posts-wrapper">
            <div className="post">
                <div className="post-sidebar">
                    <ThumbUpOffAltIcon className="upvote"/>
                    <span>Number</span>
                    <ThumbDownOffAltIcon className="downvote"/>
                </div>
                <div className="post-title">
                    <span>Posted by u/</span>
                    <div className="post-title-username">Username</div>
                    <div className="post-title-time">Time</div>
                    <div style={{ marginLeft: 'auto' }}>
                        <Button className="follow-button" label="+Follow"/> {/* Added className for styling */}
                    </div>
                </div>
                <div className="post-body">Post Content Here</div>
                <div className="post-footer">Footer Content Here</div>
            </div>
        </div>
    );
}
